import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './layout/Navbar';
import Home from './pages/Home';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
     <Navbar />

     <Routes>
      <Route path="/" element={<Home />} />
     </Routes>
    </div>
  );
}

export default App;
